function onLoad(save_state)
  self.createButton({
    click_function = "PutCrop",
    function_owner = self,
    position       = {-0.6,0.2,0.64},
    scale = {1.5,1.5,1.5},
    color = {0,0,0,0.1},
    tooltip = "Single click to put normal crop on field.\nDouble click to put quality crop on field."
  })
end

function PutCrop()
  if Stop == false then
  Wait.time(
    function()
      if QualityUp then
        self.takeObject({
          position          = CropsPos[WaterValue],
          rotation          = {0,180,180}
        })
        QualityUp = false
        Stop = false
        broadcastToAll("Quality " .. string.gsub(self.getName(), " Tiles", "") .. " seed put on field")
      else
        self.takeObject({
          position          = CropsPos[WaterValue],
          rotation          = {0,180,0}
        })
        QualityUp = false
        Stop = false
        broadcastToAll("Normal " .. string.gsub(self.getName(), " Tiles", "") .. " seed put on field")
      end
    end, 0.2)
  end
  if Stop then
    QualityUp = true
  end
  Stop = true
end
